# --- Results Logic ---
model_path = "best_model.pth"

if detect_clicked or predict_clicked:
    if before_file and after_file:
        if not os.path.exists(model_path):
            st.warning(" ENGINE STATUS: Model is still training in the background. Please wait for the first checkpoint.")
        else:
            with st.spinner("Initializing Neural Engine... Rendering Analytics..."):
                # Save uploaded files temporarily
                with open("temp_before.png", "wb") as f:
                    f.write(before_file.getbuffer())
                with open("temp_after.png", "wb") as f:
                    f.write(after_file.getbuffer())
                
                # Run prediction
                mask, stats = predict_change("temp_before.png", "temp_after.png", model_path)
                
                # --- Results Visualization ---
                st.markdown('<div class="section-header"> SPATIAL ANALYTICS RESULT</div>', unsafe_allow_html=True)
                res_v_col1, res_v_col2 = st.columns(2)
                res_v_col3, res_v_col4 = st.columns(2)
                
                with res_v_col1:
                    st.image(before_file, caption="Baseline Reference", use_container_width=True)
                with res_v_col2:
                    st.image(after_file, caption="Post-Event Impact", use_container_width=True)
                with res_v_col3:
                    mask_img = Image.fromarray(mask)
                    st.image(mask_img, caption="Binary Change Mask", use_container_width=True)
                with res_v_col4:
                    # Create a "Heatmap" style damage map
                    damage_map = np.zeros((mask.shape[0], mask.shape[1], 3), dtype=np.uint8)
                    damage_map[mask > 0] = [244, 63, 94] # Red for damage
                    st.image(damage_map, caption="Damage Intensity Map", use_container_width=True)

                # --- Metrics Dashboard ---
                st.markdown('<div class="section-header"> PERFORMANCE METRICS & ASSESSMENT</div>', unsafe_allow_html=True)
                
                # Severity Styles
                sev = stats['severity']
                bg_color = {"Low": "#065f46", "Moderate": "#92400e", "High": "#991b1b", "Critical": "#450a0a"}.get(sev, "#1e293b")
